package com.lepu.ecg500.entity;public class PatientSettingConfigEnum {	public enum HeightWeightUnit {		/**		 * cm/kg		 */		UNIT_CM_KG("cm/kg","cm/kg"),		/**		 * inch/lb		 */		UNIT_INCH_LB("inch/lb","inch/lb");		private String name;		private Object value;		HeightWeightUnit(String name, Object value){			this.name = name;			this.value = value;		}		public String getName() {			return name;		}		public void setName(String name) {			this.name = name;		}		public Object getValue() {			return value;		}		public void setValue(Object value) {			this.value = value;		}	}	public enum BloodPressureUnit{		UNIT_MMHG("mmhg",""),		UNIT_KPA("kpa","");		private String name;		private Object value;		BloodPressureUnit(String name, Object value){			this.name = name;			this.value = value;		}		public String getName() {			return name;		}		public void setName(String name) {			this.name = name;		}		public Object getValue() {			return value;		}		public void setValue(Object value) {			this.value = value;		}	}}